  false,\n\t\"url\": null,\n\t\"notes\": \"This data set comprises the Environmental
  Sensitivity Index (ESI) data for the Virgin Islands. ESI data characterize estuarine
  environments and wildlife by their sensitivity to spilled oil. The ESI data include
  information for three main components: shoreline habitats, sensitive biological
  resources, and human-use resources. This data set contains sensitive biological
  resource data for habitats.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
